INSERT INTO `variables` VALUES ('mail_retard_body','<h1>Message automatique de la Médiathèque</h1>\r\n<font color=\"red\"><b>Bonjour : ceci est un test d\'envoi de mail pour les bibs qui ont du retard; tu peux tester ça avec les variables du groupe 1 et le paramétrage des fiches bibs depuis cosmogramme</b></font><br><br>\r\n<h3>Exemple de contenu : </h3>\r\n<h2>Bibliothèque  : {NOM_BIB}</h2>\r\nIl est prévu que votre bibliothèque transmette ses mises à jours tous les {ECART_AJOUTS} jours et il se trouve que vous n\'avez pas transmis de fichiers depuis {RETARD}.<br> Votre dernier envoi date du : {DATE_ENVOI}.<br><br>\r\n<b>Si vous ne souhaitez plus recevoir de mails d\'alerte, merci de le signaler à l\'administrateur du portail.</b>','Corps du mail aux bibliothèques pour les retards d\'envois de fichiers. Le mail peut être au format html.\r\nVous pouvez utiliser les variables suivantes :<br>\r\n\r\n- {NOM_BIB} : Nom de la bibliothèque<br>\r\n- {DATE_ENVOI} : Date du dernier envoi de fichiers<br>\r\n- {RETARD} : Nombre de jours de retard des envois<br>\r\n- {ECART_AJOUTS} : Nombre de jours maxi entre 2 envois défini sur la fiche bibliothèque.',1,'',1,52,'');
